import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react'; 

function App() {
  const cards = [
    {
      id: '01',
      name: 'turquoise',
      value: '#00ffff',
      clicked: false
    },
    {
      id: '02',
      name: 'tomato',
      value: '#ff6347',
      clicked: false
    },
    {
      id: '03',
      name: 'light gray',
      value: '#d3d3d3',
      clicked: false
    },
    {
      id: '04',
      name: 'orange red',
      value: '#ff4500',
      clicked: false
    },
    {
      id: '05',
      name: 'orchid',
      value: '#da70d6',
      clicked: false
    }
  ];



  return (
    <div className="App">
      {
        cards.map((card) => {
            <div className='cardHolder'>{card.name}
              </div>
        })
      }
    </div>
  );
}

export default App;
